import React from 'react';
import './Header.scss';

const Header=()=>(
    <div className='header'>
        <Link to=''>
            <Logo className='logo'/>
        </Link>
        <div className='options'>
            <Link className='option' to='/shop'>SHOP</Link>
            <Link className='option' to='/contact'>CNOTACT</Link>
        </div>
    </div>
)

export default Header;
